import React from "react";
import "./App.css";
import axios from "axios";

function App() {
  return (
    <div className="App">
      {async function test() {
        const res = await axios.post("http://localhost:3001", {
          username: "bob",
          password: "bob123",
        });
        console.log(res);
      }}
    </div>
  );
}

export default App;
